import React from "react";
import { Wrap, FlexItem, FlexItems } from "../styles/Partners";
import CountUp from 'react-countup';


function Partners() {
  return <Wrap>
      <div className="container">
          <FlexItems>
              <FlexItem>
                  <CountUp end={100}/>
                  <CountText>Senior and leadership hires</CountText>
              </FlexItem>

              <FlexItem>
              <CountUp end={100}/>
                  <CountText>Senior and leadership hires</CountText>
              </FlexItem>
          </FlexItems>
      </div>
  </Wrap>;
}

export default Partners;
